        vk.beta = Pairing.G2Point([uint256(0x07455afd10e48d8adc94c6cb955f7a13056cbeabe270c60696cd586838f636d7), uint256(0x160ae88dcd3c4fe37fde12f5d044e1fefb4310ec954b5d1d6c8ec23d5b3de0cf)], [uint256(0x0c3e3f64aabf0b0ae49fc5b2385c0a5359528c960bd88ee56328ccf699116425), uint256(0x25aca19f499752f75387c0c6901d2ba83cc1dc78671797f5de5f8b5f3909e79c)]);
        vk.gamma = Pairing.G2Point([uint256(0x2ea0755cdafbcdf3618a816638cfbb3e8b9bc2b9d9fdbb567fd9c59d3d62b89c), uint256(0x2df3f0489ee7459dcd5b8782beb2364dea66e1ada8743c537b5a4ccc2a87490d)], [uint256(0x241839646b28f60b6c5b8ed4b53ce041def39b7c6c8f355cdf22f60a8f7c8a97), uint256(0x1231f39bdf173426047abca3739c01b6d12ed0aea06569d092cbe4f9e875a52b)]);
        vk.delta = Pairing.G2Point([uint256(0x2658ffb02a5761000a58fedefdff81229b1c9a65005391e9fcf97cb1dad76db0), uint256(0x0e554ce08c1a2da9855359b951b92f09c10edf8bba7e7bef0c929e7e460e3d05)], [uint256(0x236199e5293dae8270c322b940144d4c12994be1f86aff50869af957e54a877e), uint256(0x20efc074b3d67fa539ce9662bc4dc5714e95f61bb781ddc351f86cdf031437e3)]);
        vk.gamma_abc = new Pairing.G1Point[](3);
        vk.gamma_abc[0] = Pairing.G1Point(uint256(0x2449b06d27b48336767b5d8bc4d52ce228cc60ee92630a6c222ef9e503d7cea5), uint256(0x1ca11db41c01dbcd955f04fbea589ac80c864c58ca5aa5285d6b2e3302245750));
        vk.gamma_abc[1] = Pairing.G1Point(uint256(0x17a9beae3e09c309278103e632111b91b6c9d640f951d3aeac03591da8ae40b5), uint256(0x206e10fcb53fb98deea10f1d28f421df58f36c8e112377605ec75c6ae659ba16));
        vk.gamma_abc[2] = Pairing.G1Point(uint256(0x11314268e0c3005c6ca1091e87af9b5a4d47b502fd78438ce37ce21c695a150f), uint256(0x0990366392596fe4448bfac48faf76b4ef813f4af858627007105c6bc94cef7c));
    }
    function verify(uint[] memory input, Proof memory proof) internal view returns (uint) {
        uint256 snark_scalar_field = 21888242871839275222246405745257275088548364400416034343698204186575808495617;
        VerifyingKey memory vk = verifyingKey();
        require(input.length + 1 == vk.gamma_abc.length);
        // Compute the linear combination vk_x
        Pairing.G1Point memory vk_x = Pairing.G1Point(0, 0);
        for (uint i = 0; i < input.length; i++) {
            require(input[i] < snark_scalar_field);
            vk_x = Pairing.addition(vk_x, Pairing.scalar_mul(vk.gamma_abc[i + 1], input[i]));
        }
        vk_x = Pairing.addition(vk_x, vk.gamma_abc[0]);
        if(!Pairing.pairingProd4(
             proof.a, proof.b,
             Pairing.negate(vk_x), vk.gamma,
             Pairing.negate(proof.c), vk.delta,
             Pairing.negate(vk.alpha), vk.beta)) return 1;
        return 0;
    }
    function verifyTx(
            Proof memory proof, uint[2] memory input
        ) public view returns (bool r) {
        uint[] memory inputValues = new uint[](2);

        for(uint i = 0; i < input.length; i++){
            inputValues[i] = input[i];
        }
        if (verify(inputValues, proof) == 0) {
            return true;
        } else {
            return false;
        }
    }
}

